import React from "react";
import { Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import StudentRegisterPage from "./pages/StudentRegisterPage";
import StudentLoginPage from "./pages/StudentLoginPage";
import StudentDashboardPage from "./pages/StudentDashboardPage";
import IndustryRegisterPage from "./pages/IndustryRegisterPage";
import IndustryLoginPage from "./pages/IndustryLoginPage";
import IndustryDashboardPage from "./pages/IndustryDashboardPage";
import AdminLoginPage from "./pages/AdminLoginPage";
import AdminDashboardPage from "./pages/AdminDashboardPage";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/register" element={<StudentRegisterPage />} />
      <Route path="/student-login" element={<StudentLoginPage />} />
      <Route path="/student-dashboard" element={<StudentDashboardPage />} />
      <Route path="/industry-register" element={<IndustryRegisterPage />} />
      <Route path="/industry-login" element={<IndustryLoginPage />} />
      <Route path="/industry-dashboard" element={<IndustryDashboardPage />} />
      <Route path="/admin-login" element={<AdminLoginPage />} />
      <Route path="/admin-dashboard" element={<AdminDashboardPage />} />
      {/* Add other routes if needed */}
    </Routes>
  );
}

export default App;
